import React, { Component } from "react";

class NavBar extends Component {
    constructor(props){
        super(props);
        this.state = { apiResponse: "" };
      }

      tester(){
          console.log("111111111")
          .then(res => res.text())
          .then(res => this.setState({ apiResponse: res}))
          .catch(err => err);
      }

      componentDidMount(){
        this.tester();
      }

      render(){
          return(
              <p>{this.state.apiResponse}</p>
          );
      }

}

export default NavBar;
